import "./App.css";
import ChatPage from "./Components/ChatPage/ChatPage";
import SearchBar from "./Components/SearchBar/SearchBar";
import UsersContainer from "./Components/Users/UsersContainer";

function App() {
  return (
    <div className="appWrapper">
      <SearchBar />
      <UsersContainer />
      <ChatPage />
    </div>
  );
}

export default App;
